    },
    description: String,
    views: {
        type: Number,
        default: 0
    },
    createdAt: {
        type: Date,
        default: Date.now
    },
    comments: [{
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Comment' //어느 모델에서 온 건지 명시
    }]
});
//여기까진  shape definition

const model = mongoose.model('Video', VideoSchema); //actuall document shape
